import React, { useState, useEffect } from "react";

const Breweries = () => {
  const [breweries, setBreweries] = useState([]);

  const data = async () => {
    const res = await fetch("https://api.openbrewerydb.org/breweries");
    const json = await res.json();
    setUsers(json.data);
  };

  useEffect(() => {
    data();
  }, []);

  return (
          <div class="bg-light">
            <Nav/>
            <div class="container px-5 my-5">
              <div class="text-center mb-5">
                <h1 class="fw-bolder">List Breweries</h1>
              </div>

              <div class="row gx-5 content-center">
                {breweries.map((brewery) => {
                    return (
                      <div key={brewery.id} class="col-xl-4 mb-5">
                        <div className="text-reset text-decoration-none">
                          <div class="card mb-5 mb-xl-0">
                            <div class="card-body p-5">
                              <div class="text-center">
                                <span>{brewery.name}</span>
                                <p>{brewery.city}</p>
                              </div>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })}
              </div>
            </div>

          </div>
  );
}

export default Breweries;
